import NextApp from 'next/app';
import Head from 'next/head';
import { ThemeProvider, CssBaseline, theme } from '@arbete/ui';

import Header from '~/components/Header';

const App = ({ Component, pageProps }) => {
  return <>
    <Head>
      <title>WOop</title>
    </Head>
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Header />
      <Component {...pageProps} />
    </ThemeProvider>
  </>
}

export default App;
